import React from "react";
import { Link } from "react-router-dom";

function CardItem(props) {
  return (
    <>
      <li className="cards__item">
        <img className="cards__item__img" alt="Travel Image" src={props.src} />
      </li>
    </>
  );
}

export default CardItem;
